import React, { Component } from 'react'

export class ProfileItem extends Component {
    render() {
        return (
            <div>
                <span >
                <img   src={ this.props.profile.path }
                     alt="Not Found"/> 
                <p>{ this.props.profile.name }</p>
                </span>
            </div>
        )
    }
}

export default ProfileItem
